import React from 'react';

const SearchPage = () => {
  return (
    <div className="p-4">
      <h2 className="text-2xl font-semibold mb-4">Search Mutual Funds</h2>
      <input className="border p-2 rounded w-full" placeholder="Search by fund name..." />
    </div>
  );
};

export default SearchPage;
